import { render } from "@testing-library/react";
import React, { Fragment } from "react";
import Card from "./card";

class Home extends React.Component {
  render() {
    return (
      <Fragment>
        div.card-group
        <Card />
        <Card />
        <Card />
        <Card />
      </Fragment>
    );
  }
}

export default Home;
